import React, { Component } from 'react';
import DecisionTreeImage from '../images/decisionTree.png';
import ImageFilter from '../images/imageFilter.png';

export class Projects extends Component {
    render() {
        return (
            <div style={main}>
                <h2 style={headingText}>Technical Projects</h2>
                <div style={projectsSection}>
                     <div style={project}>
                        <h1>Machine Learning - Decision Tree</h1>
                        <img src={DecisionTreeImage} />
                        <div style={imageOverlay}>A python project which creates a decision tree using a csv file.</div>

                     </div>
                     <div>

                     </div>

                </div>
            </div>

        )
    }

}

const main = {
    display: 'flex',
    height: '100vh',
    backgroundColor: "#2fada1"
};

const headingText = {
    marginLeft: '20px',
    fontSize: '3rem',
    color: '#ffffff'
}

const projectsSection = {
    display: 'grid'
}

const imageOverlay = {
    position: 'absolute',
    bottom: 0,
    background: 'rgb(0, 0, 0)',
    background: 'rgba(0, 0, 0, 0.5)', /* Black see-through */
    color: '#f1f1f1',
    width: '100%',
    transition: '.5s ease',
    opacity: 0,
    color: 'white',
    fontSize: 20,
    padding: 20,
    textAlign: 'center'
}

const project = {
    gridColumnStart: 3, 
    gridRowStart: 2,
    position: 'relative',
    width: '50%',
    maxWidth: 300
}

const image = {
    display: 'block',
    width: '100%',
    height: 'auto'
}

export default Projects;
